import React from 'react';

function HospitalFooter() {
  return (
    <footer style={{ backgroundColor: '#333', color: 'white', padding: '20px', textAlign: 'center' }}>
      <div>
        <h4>Contact Us</h4>
        <p>123 Medical Street, Cityville, Country</p>
        <p>Phone: +123 456 7890</p>
        <p>Email: info@hospital.com</p>
      </div>
      <div>
        <p>&copy; 2024 Hospital Name. All rights reserved.</p>
      </div>
    </footer>
  );
}

export default HospitalFooter;
